css:
.datatip-marked > div:not(:last-child) {
  border-bottom: 1px solid rgba(82, 139, 255, 0.1);
}
.datatip-marked-container {
  color: #abb2bf;
  font-family: 'BlinkMacSystemFont', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  max-height: 300px;
  max-width: 500px;
  overflow: auto;
  padding: 8px;
  white-space: normal;
}
.datatip-marked-container :first-child {
  margin-top: 0;
}
.datatip-marked-container :last-child {
  margin-bottom: 0;
}
.datatip-marked-text-editor-container {
  padding: 2px 0 2px 4px;
}
.datatip-marked-text-editor {
  max-width: 500px;
  max-height: 300px;
  overflow: auto;
}
.datatip-marked-text-editor atom-text-editor {
  background-color: transparent;
  min-width: 1em;
}
.datatip-marked-text-editor atom-text-editor .editor-contents--private {
  cursor: inherit!important;
}
.datatip-marked-text-editor atom-text-editor .scroll-view .horizontal-scrollbar {
  display: none;
}
.datatip-marked-text-editor atom-text-editor .scrollbar-corner {
  display: none;
}
